            <div className='expense-item__description'>
                <h2>{items_list.listOne}</h2>
                <h2>{LocationOfExpenditure.locaOne}</h2>
                <div className='expense-item__price'>{items_price.listOnePrice}</div>
            </div>
        </div>

        </div>
        
    );
}

export default ExpenseItem;
